CREATE DEFINER=`root`@`%` PROCEDURE `usp_getProductsByPrice`(
	IN max bit
)
BEGIN
IF (max) THEN
   SELECT id, sku, name, price, attribute  FROM Products WHERE price IN (SELECT MAX(price) FROM Products );
ELSE
	SELECT id, sku, name, price, attribute FROM Products WHERE price IN (SELECT MIN(price) FROM Products );
END IF;

END ;;
