CREATE DEFINER=`root`@`%` PROCEDURE `usp_getProductsByRating`(
	IN max bit
)
BEGIN
	CREATE TEMPORARY TABLE tmpratings (id INT, rating decimal(6,1));

	INSERT INTO tmpratings(id,rating)
	SELECT Products.id , rating.rating
	 FROM Products, 
	 JSON_TABLE(attribute, '$[0]'
	 COLUMNS (
				rating decimal(6,1)  PATH '$.rating.value')
	 ) rating;
	 
	 IF (max) THEN
		SELECT p.id, p.sku, p.name, p.price, p.attribute FROM Products p 
		INNER JOIN (SELECT DISTINCT id, rating FROM tmpratings ORDER BY rating DESC  LIMIT 3) tr ON tr.id = p.id;
    ELSE
		SELECT p.id, p.sku, p.name, p.price, p.attribute  FROM Products p 
		INNER JOIN (SELECT DISTINCT id, rating FROM tmpratings ORDER BY rating LIMIT 3) tr ON tr.id = p.id;
    END IF;
	 
	 DROP TABLE tmpratings;
 END ;;
